import { Link } from "react-router-dom";

function MatchLine(props) {
    const matchData = props.matchData
    console.log(matchData)

    let dateString = matchData?.status?.utcTime
    const dateObject = new Date(dateString);

    const formattedTime = dateObject.toLocaleTimeString("en-US", {
      hour: "numeric",
      minute: "numeric",
      hour12: true
    });

    const matchUrl = matchData?.matchUrl;
    const regex = /#(\d+)$/;
    const matchResult = matchUrl?.match(regex);
    const extractedNumbers = matchResult ? matchResult[1] : null;

    const dataOriginale = new Date(matchData?.status?.utcTime);
    const formatoData = new Intl.DateTimeFormat('en-US', { month: 'long', day: 'numeric', year: 'numeric' });
    const h2hDate = formatoData.format(dataOriginale);

    return (
        <Link to={"/match-details/" + (matchData.id || extractedNumbers)}>
            <div className="flex gap-4 flex-col">
                {props.h2h &&
                <div className="flex justify-between">
                    <div>{h2hDate}</div>
                    <img alt="matchLeagueIcon" className="h-4" src={`https://images.fotmob.com/image_resources/logo/leaguelogo/${matchData?.general?.parentLeagueId}.png`}></img>
                </div>
                }
                <div className="flex items-center">
                    <div className="w-100 flex gap-5 items-center justify-center relative">       
                        <div className="flex flex-1 gap-3 items-center justify-end">
                            <Link to={"/team/" + (matchData.home.id)}>
                                <img className="h-6 w-6 object-contain" src={`https://images.fotmob.com/image_resources/logo/teamlogo/${matchData.home.id}.png`} alt="teamLogo" />
                            </Link>
                            <div className="font-sm hidden md:block text-nowrap truncate">{matchData.home.name}</div>
                        </div>
                        <div className="flex flex-2 text-center justify-center">
                        {matchData.status.finished && matchData.status.cancelled ? (
                            // <span className="text-nowrap bg-red-100 text-red-800 text-xs font-medium px-2.5 py-0.5 rounded border border-red-400">
                            //     {matchData.status.reason.short}
                            // </span>
                            <div className=" text-gray-800 text-sm absolute top-0 start-0 bg-gray-400 rounded-full px-3 py-0.5">
                                {matchData.status.reason.short}
                            </div>
                        ) : matchData.status.finished ? (
                            // <span className="text-nowrap bg-orange-100 text-orange-800 text-xs font-medium px-2.5 py-0.5 rounded border border-orange-400">
                            //     {matchData.status?.scoreStr}
                            // </span>
                            <>
                                <div className="text-gray-600 text-sm absolute top-0 start-0 bg-gray-200 rounded-full px-3 py-0.5">
                                    {matchData.status.reason.short}
                                </div>
                                <div className="text-lg font-medium">
                                    {matchData.status?.scoreStr}
                                </div>
                            </>
                        ) : (
                            <>
                                {matchData.status.ongoing ? (
                                    <div className="flex gap-3 items-center">
                                        <div className="text-white absolute top-0 text-sm start-0 bg-green-600 rounded-full px-3 py-0.5">
                                            {matchData.status.liveTime.short.replace("â€™", '')}
                                        </div>
                                        {/* <span className="h-fit w-full text-nowrap bg-green-100 text-green-800 text-xs font-medium px-2.5 py-0.5 rounded border border-green-400">
                                            {matchData.status.liveTime.short}
                                        </span> */}
                                        {/* <span className="h-fit text-nowrap bg-gray-100 text-gray-800 text-xs font-medium px-2.5 py-0.5 rounded border border-gray-400">
                                            {matchData.status.scoreStr}
                                        </span> */}
                                        <div className="text-lg font-medium">
                                            {matchData.status?.scoreStr}
                                        </div>
                                    </div>
                                ) : (
                                    <div className="text-lg font-medium">
                                        {formattedTime}
                                    </div>
                                )}
                            </>
                        )}
                        </div>
                        <div className="flex flex-1 gap-3 items-center justify-start">
                            <div className="font-sm hidden md:block text-nowrap truncate">{matchData.away.name}</div>
                            <Link to={"/team/" + (matchData.away.id)}>
                                <img className="h-6 w-6 object-contain" src={`https://images.fotmob.com/image_resources/logo/teamlogo/${matchData.away.id}.png`} alt="teamLogo" />
                            </Link>
                        </div>            
                    </div>
                </div>
            </div>
        </Link>
    )
}

export default MatchLine
